import React from 'react'
import{
    MDBNavbar,
    MDBNavbarBrand,
    MDBCollapse,
    MDBNavbarNav,
    MDBNavItem,
} from "mdbreact";

function Navbar() {
    return (
        <div>
        <MDBNavbar color="indigo" dark expand="md">
        <MDBNavbarBrand>
        <strong className="white-text">Shipping Box</strong>
        </MDBNavbarBrand>
        <MDBCollapse id="navbarcollapse3" navbar>
            <MDBNavbarNav right>
            <MDBNavItem >
            </MDBNavItem>
            </MDBNavbarNav>
        </MDBCollapse>
        </MDBNavbar>
        </div>
    )
}

export default Navbar;
